import React, { Component } from "react";

class Subject extends Component {
    render() {
        return (
            <header>
                <h2>공지사항</h2>
            </header>
        )
    }
}

class nobdList extends Component {
    render(){
        return (
            <div>
                <Subject>
                    <h2>공지사항</h2>
                </Subject>

                <nav>
                    <ul>
                        <li><a href="#">HTML</a></li>
                        <li><a href="#">CSS</a></li>
                        <li><a href="#">JavaScript</a></li>
                    </ul>
                </nav>

                <article>
                    by serim
                </article>
            </div>
        )
    }
}
export default nobdList;
